houseIdList.forEach((element) => {
  //alert(element);
  getJson(element);
});

function getJson(houseNum) {
  let url = 'https://anapioficeandfire.com/api/houses/';

  fetch(url + houseNum)
    .then((res) => res.json())
    .then((out) => {
      console.log('Checkout this JSON! ', out);
    })
    .catch((err) => {
      throw err;
    });
}
